import React from 'react';
import styled from 'styled-components';

import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';

import 'bootstrap/dist/css/bootstrap.min.css';

const List = () => {
  return (
    <Wrapper>
      <TierGroup>
        <div className='team-info'>
          <div className='grade'>S</div>
          <div className='team'>
            <div className='team-title'>Bruiser Warrios</div>
            <div className='team-style'>Slow Roll (7)</div>
          </div>
        </div>
        <ul className='team-comps'>
          <li className='teammates'>
            <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
            <div className='teammates-name'>Jinx</div>
          </li>
          <li className='teammates'>
            <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
            <div className='teammates-name'>Jinx</div>
          </li>
          <li className='teammates'>
            <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
            <div className='teammates-name'>Jinx</div>
          </li>
          <li className='teammates'>
            <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
            <div className='teammates-name'>Jinx</div>
          </li>
          <li className='teammates'>
            <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
            <div className='teammates-name'>Jinx</div>
          </li>
          <li className='teammates'>
            <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
            <div className='teammates-name'>Jinx</div>
          </li>
          <li className='teammates'>
            <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
            <div className='teammates-name'>Jinx</div>
          </li>
          <li className='teammates'>
            <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
            <div className='teammates-name'>Jinx</div>
          </li>
        </ul>
        <KeyboardArrowDownIcon
          style={{ width: 22, height: 22, color: 'rgba(255,255,255,0.5)' }}
        />
      </TierGroup>
      <TierGroupExpand>
        <div className='team-expand-detail'>
          <div className='team-expand-detail-comp '>
            <h6>Early Comp</h6>
            <ul>
              <li>
                <img
                  src='https://rerollcdn.com/characters/Base/Lulu.png'
                  alt=''
                />
              </li>
              <li>
                <img
                  src='https://rerollcdn.com/characters/Base/Lulu.png'
                  alt=''
                />
              </li>
              <li>
                <img
                  src='https://rerollcdn.com/characters/Base/Lulu.png'
                  alt=''
                />
              </li>
              <li>
                <img
                  src='https://rerollcdn.com/characters/Base/Lulu.png'
                  alt=''
                />
              </li>
              <li>
                <img
                  src='https://rerollcdn.com/characters/Base/Lulu.png'
                  alt=''
                />
              </li>
            </ul>
          </div>
          <div className='team-expand-detail-traits '>
            <h6>Traits</h6>
            <ul>
              <li></li>
            </ul>
          </div>
          <div className='team-expand-detail-item '>
            <h6>Carousel</h6>
            <div className='team-expand-detail-item-group'>
              <div className='part'>
                <img src='https://rerollcdn.com/items/RecurveBow.png' alt='' />
                <div className='main'>
                  <img
                    src='https://rerollcdn.com/items/GuinsoosRageblade.png'
                    alt=''
                  />
                </div>
              </div>
              <ArrowForwardIosIcon
                style={{
                  width: 15,
                  height: 15,
                  color: 'rgba(255,255,255,0.5)',
                }}
              />
              <div className='part'>
                <img src='https://rerollcdn.com/items/RecurveBow.png' alt='' />
                <div className='main'>
                  <img
                    src='https://rerollcdn.com/items/GuinsoosRageblade.png'
                    alt=''
                  />
                </div>
              </div>
              <ArrowForwardIosIcon
                style={{
                  width: 15,
                  height: 15,
                  color: 'rgba(255,255,255,0.5)',
                }}
              />
              <div className='part'>
                <img src='https://rerollcdn.com/items/RecurveBow.png' alt='' />
                <div className='main'>
                  <img
                    src='https://rerollcdn.com/items/GuinsoosRageblade.png'
                    alt=''
                  />
                </div>
              </div>
            </div>
          </div>
          <div className='team-expand-detail-options'>
            <h6>Options</h6>
            <div className='options-list'>
              <img
                src='https://rerollcdn.com/characters/Base/Lulu.png'
                alt=''
              />
              <ArrowForwardIosIcon
                style={{
                  width: 15,
                  height: 15,
                  color: 'rgba(255,255,255,0.5)',
                }}
              />
              <img
                src='https://rerollcdn.com/characters/Base/Lulu.png'
                alt=''
              />
              <img
                src='https://rerollcdn.com/characters/Base/Lulu.png'
                alt=''
              />
            </div>
            <div className='options-list'>
              <img
                src='https://rerollcdn.com/characters/Base/Lulu.png'
                alt=''
              />
              <ArrowForwardIosIcon
                style={{
                  width: 15,
                  height: 15,
                  color: 'rgba(255,255,255,0.5)',
                }}
              />
              <img
                src='https://rerollcdn.com/characters/Base/Lulu.png'
                alt=''
              />
              <img
                src='https://rerollcdn.com/characters/Base/Lulu.png'
                alt=''
              />
            </div>
          </div>
          <div className='team-expand-detail-position'>
            <h6>Positioning</h6>
          </div>
        </div>
      </TierGroupExpand>
    </Wrapper>
  );
};

export default List;

const Wrapper = styled.div``;

const TierGroup = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  width: 100%;
  border: 1px solid #17313a;
  cursor: pointer;
  margin: 7.5px 0;
  background: #102531;
  padding: 15px 15px 15px 15px;
  margin-top: 20px;

  & .grade {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 25px;
    height: 25px;
    padding: 5px;
    margin-right: 20px;
    color: #0d202b;
    font-weight: 600;
    border-radius: 2.5px;
    cursor: default;
    background: #ff7f7f;
  }

  & .team {
    &-info {
      display: flex;
      align-items: center;
    }
    &-title {
      color: rgba(255, 255, 255, 0.9);
      font-weight: 500;
    }
    &-style {
      display: inline-flex;
      align-items: center;
      color: #88a0a7;
      font-size: 12px;
      font-weight: 400;
      letter-spacing: 0.05em;
      margin-top: 2px;
      background: #123040;
      padding: 2px 4px;
      border-radius: 4px;
    }
    &-comps {
      display: flex;
      align-items: center;
      margin: 0;
      gap: 14px;
      & .teammates {
        & img {
          border: 1px solid red;
          width: 45px;
          height: 45px;
          min-width: 45px;
          min-height: 45px;
          margin-bottom: 5px;
        }
        &-name {
          width: 45px;
          font-weight: 500;
          min-height: 15px;
          white-space: nowrap;
          overflow: hidden;
          text-overflow: ellipsis;
          font-size: 11px;
          text-align: center;
          color: #88a0a7;
          line-height: 1.3em;
        }
      }
    }
  }
`;

const TierGroupExpand = styled.div`
  & .team-expand {
    &-detail {
      display: grid;
      grid-template-rows: repeat(2, 1fr);
      grid-template-columns: repeat(6, 1fr);

      @media (max-width: 1260px) {
        grid-template-rows: repeat(3, 1fr);
      }
      @media (max-width: 576px) {
        grid-template-columns: repeat(1, 1fr);
        grid-template-rows: repeat(6, 1fr);
      }
      & h6 {
        color: #88a0a7;
        font-size: 13px;
        font-weight: 500;
        text-align: center;
      }
      & > div {
        display: flex;
        align-items: center;
        justify-content: center;
        flex-direction: column;
      }
      &-comp {
        grid-column: 1 / 3;
        grid-row: 1 / 2;
        @media (max-width: 1260px) {
          grid-column: 1 / 4;
          grid-row: 1 / 2;
        }
        @media (max-width: 576px) {
          grid-column: 1 / -1;
          grid-row: 1 / 2;
        }

        & ul {
          display: flex;
          gap: 8px;
          & li {
            & img {
              width: 35px;
              height: 35px;
              min-width: 35px;
              min-height: 35px;
              border: 1px solid red;
            }
          }
        }
      }
      &-traits {
        grid-column: 3 / 5;
        grid-row: 1 / 2;
        @media (max-width: 1260px) {
          grid-column: 4 / -1;
          grid-row: 1 / 2;
        }
        @media (max-width: 576px) {
          grid-column: 1 / -1;
          grid-row: 2 / 3;
        }
      }
      &-item {
        grid-column: 5 / -1;
        grid-row: 1 / 2;
        @media (max-width: 1260px) {
          grid-column: 1 / 4;
          grid-row: 2 / 3;
        }
        @media (max-width: 576px) {
          grid-column: 1 / -1;
          grid-row: 3 / 4;
        }

        &-group {
          display: flex;
          align-items: center;
          gap: 15px;

          & .part {
            position: relative;
            & img {
              width: 32px;
              height: 32px;
              min-width: 32px;
              min-height: 32px;
            }
            & .main {
              position: absolute;
              top: 100%;
              right: 0;
              transform: translate(30%, -70%);

              & img {
                width: 18px;
                height: 18px;
                min-width: 18px;
                min-height: 18px;
              }
            }
          }
        }
      }
      &-options {
        grid-column: 1 / 4;
        @media (max-width: 1260px) {
          grid-column: 4 / -1;
          grid-row: 2 / 3;
        }
        & .options-list {
          & img {
            width: 35px;
            height: 35px;
            min-width: 35px;
            min-height: 35px;
          }
        }
      }
      &-position {
        grid-column: 4 / -1;
        @media (max-width: 1260px) {
          grid-column: 1 / -1;
          grid-row: 3 / -1;
        }
      }
    }
  }
`;
